import "./App.css";
import { BiSearch } from "react-icons/all";
function App() {
  return (
    <div className="container">
      <div className="searchbar">
        <BiSearch className="icon" />
        <input className="search" placeholder="Search" />
      </div>
      <div className="card">
        <div className="zone">
          <p>Argentina</p>
          <p>GMT+0</p>
        </div>
        <div className="time">
          <p>17:30:47</p>
        </div>
      </div>
      <div className="card"></div>
      <div className="card"></div>
    </div>
  );
}

export default App;
